import React, {FC} from "react";
import MyInput from "../components/UI/input/MyInput";

const AdminPage: FC =() => {

    const [minPrice, setMinPrice] = useState('')
    const minPricing = (sort:string) => {
        setMinPrice(sort);

    }
    return (
        <div>
                                <MyInput 
                        value={minPrice}
                        onChange={minPricing}
                        placeholder = "0"
                    />
            <button>Добавить позицию</button>
        </div>
    )
}

export default AdminPage;
